<?phpnamespace BackBundle\Controller;use BackBundle\Entity\Company;use BackBundle\Form\CompanyType;use Symfony\Bundle\FrameworkBundle\Controller\Controller;use Sensio\Bundle\FrameworkExtraBundle\Configuration\Route;use Symfony\Component\HttpFoundation\Request;use Symfony\Component\HttpFoundation\Response;use BackBundle\Entity\User;/** * Class UserController * @package BackBundle\Controller * @Route("/company") */class CompanyController extends Controller{    /**     * @Route("/all", name="back_company_list")     * @param Request $request     * @return Response     */    public function indexAction(Request $request)    {        $em = $this->getDoctrine()->getEntityManager();        $pageLimited = array(20, 30, 50, 100);        $limit = ($request->get('limit') !== null && in_array($request->get('limit'), $pageLimited)) ? $request->get('limit') : 20;        $search = ($request->get('q') != null) ? $request->get('q') : null;        $query = $em->getRepository('BackBundle:Company')->createQueryBuilder('company');        if ($search !== null) {            $query->where('company.name like :search')                ->orWhere("company.phone like :search")                ->setParameter('search', "%" . $search . "%");        }        $query->orderBy('company.id', 'DESC');        $companies = $this->get('knp_paginator')            ->paginate(                $query, /* query NOT result */                $request->query->getInt('page', 1)/*page number*/,                $limit/*limit per page*/            );        return $this->render('BackBundle:Company:list.html.twig', array(                'companies' => $companies,                'pageLimited' => $pageLimited,            )        );    }    /**     * @Route("/add", name="back_company_add")     * @param Request $request     * @return Response     */    public function addAction(Request $request)    {        $em = $this->getDoctrine()->getManager();        $company = new Company();        $form = $this->createForm(CompanyType::class, $company);        $form->handleRequest($request);        if ($form->isSubmitted() && $form->isValid()) {            //$em->persist($customer);            //$em->flush();            die("add");            return $this->redirectToRoute('back_company_list');        }        return $this->render('BackBundle:Company:add.html.twig', array(            'form' => $form->createView(),        ));    }    /**     * @Route("/edit/{slug}", name="back_company_edit")     * @param Request $request     * @param $slug     * @return Response     */    public function editAction(Request $request, $slug)    {        die("Edit");        return $this->render('BackBundle:Pages:index.html.twig');    }    /**     * @Route("/remove", name="back_company_remove")     * @param Request $request     * @return Response     */    public function removeAction(Request $request)    {        die("remove");        return $this->render('BackBundle:Pages:index.html.twig');    }    /**     * @Route("/data", name="back_company_data")     * @param Request $request     * @return Response     */    public function addedAction(Request $request)    {        die("ADD ====> Warning");        $em = $this->getDoctrine()->getEntityManager();        $cp = [            ["name" => "HATOLOGY",                "lastNameRepresentative" => "Hendricks",                "firstNameRepresentative" => "Jennie ",                "email" => "jenniehendricks@hatology.com",                "siret" => "519 68 834 57297",                "tva" => "FR 85 519 68 834 57297",                "address" => "388 Battery Avenue, 9374",                "additionalAddresse" => "Cedex 82",                "country" => "North Dakota",                "postalCode" => 96359,                "city" => "France",                "phone" => "01 67 15 21 35",                "mobile" => "06 27 62 60 70",                "image" => "ht